
function test_url()
{
    url=$1
    shift
    code=$1
    shift
    headers=("$@")
    
    # wget filters the URLs and removes the . and .. path nodes.
    #wget -q -S -O /dev/null http://0.0.0.0:8080/$url > /tmp/tmp.out 2>&1
    # Using netcat instead
    printf "GET /$url HTTP/1.1\r\nHost: me\r\n\r\n" | nc 127.0.0.1 8080 > /tmp/tmp.out
    
    if [ $? != $code ];
    then
        echo "Failure: Download of $url (wget exit code $?)"
        return;
    fi
    
    for i in "${headers[@]}";
    do
        grep "$i" /tmp/tmp.out > /dev/null 
        if [ $? != 0 ];
        then
            echo "Failure: No such header in $url: '$i'"
            return;
        fi
    done

    echo "Success: $url"
}


